export class MPEG {
    static isHeader(data: any, offset: any): boolean;
    static appendFrame(track: any, data: any, offset: any, pts: any, frameIndex: any): {
        length: number;
    };
    static parseHeader(data: any, offset: any): {
        sampleRate: number;
        channelCount: number;
        frameLength: number;
        samplesPerFrame: number;
    };
}
